static void entest1(Hashtable ht, int size) {
  int sum = 0;

  timer.start("Iter Enumeration Key   ", size);
  for (Enumeration en = ht.keys(); en.hasMoreElements();) {
    if (en.nextElement() != MISSING)
      ++sum;
  }
  timer.finish();
  reallyAssert(sum == size);
}

